import React from 'react';
import Header from './components/header';
import "./styles.css";
import Umidade from './pages/main/umidade';


const App = () => (
  <div className="App">
    <Header/>
    <Umidade />
    <h1>Umid Graph</h1>
                <LineChart width={500} height={300} data={this.umid}>
                <XAxis dataKey="{this.date}" />
                <YAxis />
                <Line dataKey="{this.date}" />
                </LineChart> 
  </div>
);




export default App;
